CREATE TABLE mytable(
   id       INTEGER  NOT NULL PRIMARY KEY 
  ,judul    VARCHAR(134) NOT NULL
  ,title    VARCHAR(29) NOT NULL
  ,artist   VARCHAR(39) NOT NULL
  ,folder   VARCHAR(112)
  ,album    VARCHAR(107)
  ,size     VARCHAR(8) NOT NULL
  ,duration VARCHAR(9) NOT NULL
  ,bitrate  VARCHAR(11) NOT NULL
  ,year     INTEGER  NOT NULL
  ,cover    VARCHAR(44) NOT NULL
  ,link     VARCHAR(95) NOT NULL
);
